import e from "./ToDo.module.css"
import { AiOutlineClose } from "react-icons/ai";

const ToDo = ({todo, handleCheckCompleted, handleDelete}) => {
    return (
        <li className={e.li}>
                <input type="checkbox" checked={todo.completed} onChange={() => handleCheckCompleted(todo.id)} />
                {todo.title}
            <button disabled={!todo.completed} type="button" aria-label='Close' onClick={() => handleDelete(todo.id)}>x</button>
        </li>
    )
};

export default ToDo;
